import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const ITEM_CATEGORIES = [
  "Vegetable", "Starch", "Fruit", "Canned Entree", "Sauce", "Misc",
  "Dessert", "Beans", "Snack", "Protein Entree", "Starch and Protein Entree"
];

const STORAGE_TYPES = ["Dry", "Fridge", "Freezer"];

const AddIngredient = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    ingredient_name: "",
    num_containers: "",
    units_per_container: "",
    unit: "Servings",
    expiration_date: "",
    storage_location: "",
    item_category: "",
    storage_type: "",
    container_type: "",
    brand: "",
    tefap: false,
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData({
      ...formData,
      [name]: type === "checkbox" ? checked : value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const dataToSend = {
        ...formData,
        expiration_date: formData.expiration_date || null,
        num_containers: parseInt(formData.num_containers, 10),
        units_per_container: parseFloat(formData.units_per_container),
      };

      await axios.post("http://127.0.0.1:8000/add", dataToSend);
      alert("Ingredient added successfully!");
      navigate("/");
    } catch (error) {
      console.error(error);
      alert(`Error adding ingredient: ${error.response?.data?.detail || error.message}`);
    }
  };

  return (
    <div className="flex justify-center w-full">
      <div className="w-full max-w-md bg-white shadow-md rounded-md p-6 mt-8">
        <h2 className="text-xl font-bold mb-4 text-center">Add New Ingredient</h2>
        <form onSubmit={handleSubmit} className="space-y-4">

          <input name="ingredient_name" placeholder="Ingredient Name" value={formData.ingredient_name} onChange={handleChange} required className="border p-2 w-full" />
          <input name="num_containers" type="number" placeholder="Quantity" value={formData.num_containers} onChange={handleChange} required className="border p-2 w-full" />
          <input name="units_per_container" type="number" placeholder="Units per Container" value={formData.units_per_container} onChange={handleChange} required className="border p-2 w-full" />
          <input name="unit" placeholder="Unit" value={formData.unit} onChange={handleChange} required className="border p-2 w-full" />
          <input name="expiration_date" type="date" value={formData.expiration_date} onChange={handleChange} className="border p-2 w-full" />
          <input name="storage_location" placeholder="Storage Location" value={formData.storage_location} onChange={handleChange} className="border p-2 w-full" />

          <select name="item_category" value={formData.item_category} onChange={handleChange} required className="border p-2 w-full">
            <option value="">Select Item Category</option>
            {ITEM_CATEGORIES.map((cat) => (
              <option key={cat} value={cat}>{cat}</option>
            ))}
          </select>

          <select name="storage_type" value={formData.storage_type} onChange={handleChange} required className="border p-2 w-full">
            <option value="">Select Storage Type</option>
            {STORAGE_TYPES.map((type) => (
              <option key={type} value={type}>{type}</option>
            ))}
          </select>

          <input name="container_type" placeholder="Container Type" value={formData.container_type} onChange={handleChange} className="border p-2 w-full" />
          <input name="brand" placeholder="Brand" value={formData.brand} onChange={handleChange} className="border p-2 w-full" />

          <label className="flex items-center">
            <input name="tefap" type="checkbox" checked={formData.tefap} onChange={handleChange} className="mr-2" />
            TEFAP
          </label>

          <div className="flex justify-between pt-4">
            <button type="submit" className="bg-green-500 text-white px-4 py-2 rounded">Save</button>
            <button type="button" onClick={() => navigate("/")} className="bg-gray-300 text-black px-4 py-2 rounded">Cancel</button>
          </div>

        </form>
      </div>
    </div>
  );
};

export default AddIngredient;
